import React, {Component} from 'react';

function Selection(props) {
    const { selectedWorkouts, workoutDeselect} = props;    
    
    return (
        <div className="col-md-3">
            <h1>Selection <i class="fa fa-plus"></i></h1>
            <ul id="selectionList">
            { selectedWorkouts.map(exercise => {
                return <li key={exercise._id}>{exercise.title}<span onClick={() => this.props.workoutDeselect(exercise)} className="float-right"><i class="fa fa-trash"></i></span></li>
            })}                   
            </ul>
        </div>
    )
}
export default Selection;

